import '../App.css';
import './Description.css';

function Description(){
	return(
			<div className="description-container">
			<h1>TOWER DEFENSE is waiting for you</h1>
			<p>Protect your base from the intruders and send your best units
			to crush all your enemies on your way</p>
			</div>
		)

}

export default Description;
